        "def read_circles(egoNodes,path):\n",
        "    true_circles = []\n",
        "\n",
        "    for ego in egoNodes:\n",
        "        with open(path + str(ego) + '.circles') as netfile:\n",
        "            circles = []\n",
        "\n",
        "            for j, line in enumerate(netfile):\n",
        "                lst = line.split('\\t')\n",
        "                el, es = lst[0], lst[1:]\n",
        "                circle  =[]\n",
        "                for e in es:\n",
        "                    circle.append(int(e))\n",
        "                circles.append(circle)\n",
        "        true_circles.append(circles)\n",
        "                \n",
        "    return true_circles"
